import "./colFooter.css";

const ColFooter = (props) => {
  return (
    <div className={`item-${props.index} d-flex flex-column`}>
      {props.col_number.map((el) => {
        return (
          <div>
            <p>{el}</p>
          </div>
        );
      })}
    </div>
  );
};

export default ColFooter;
